description:
&quot;Francis Mitterrand&quot; was the hit from this release. John Peel liked it.
John Darnielle played the guitar riff. Mark Durian sang background vocals with us on the original recording (not the vinyl release).
It enjoyed a bit of a resurgence in 2004 when John Peel played it again. 


